INSERT INTO `contest` (`id`, `title`, `content`, `start_date`, `end_date`, `rule`, `categoryid`, `adminid`, `thumbnail`) VALUES
(1, 'Cuộc thi ảnh chân dung chủ đề “PORTRAITURE”', 'Bạn quan niệm thế nào về ảnh chân dung ? Hãy chia sẻ quan niệm về ảnh chân dung của bạn cùng với cộng đồng Bow101 để phong phú hơn thể loại ảnh cực kì khó khăn này.', '2021-06-12 00:00:00', '2021-07-30 00:00:00', 'Ảnh dự thi sẽ được đăng trên website Bow101.com và Facebook fan Page  của Bow101.com\r\nBTC không sử dụng hình ảnh dự thi cho bất kỳ hình thức kinh doanh quảng cáo triễn lãm nào nếu chưa có sự đồng ý của tác giả.\r\nNgười thắng Giải Bình Chọn sẽ phải chọn lens 50mm 1.4  khác trong danh sách nếu Lens được chọn không có tại thị trường Việt Nam trong 1 tuần kể từ ngày công bố kết quả.\r\nBTC chỉ trao giải cho những ai đang có mặt tại Việt Nam vào thời điểm nhận giải.\r\nNhững ai ở bên ngoài TP. HCM sẽ nhận được giải thưởng sau khi confirm địa chỉ bằng nick facebook.  \r\nBTC có quyền thay đổi kết quả của tất cả các giải nếu cảm thấy có sự gian lận về bản quyền ảnh.   \r\nCác điều khoảng của cuộc thi có thể được BTC thay đổi mà không cần thông báo đến từng người tham gia đã nộp ảnh.  \r\nQuyết định của BTC là quyết định cuối cùng.   ', 1, 1, );
INSERT INTO `contest` (`id`, `title`, `content`, `start_date`, `end_date`, `rule`, `categoryid`, `adminid`, `thumbnail`) VALUES
(2, 'Cuộc thi ảnh phong cảnh Việt Nam 2021', 'Nhận ra được sức mạnh đặc trưng của nhiếp ảnh với tính chất khác biệt so với các phương tiện truyền thông khác, UNESCO hợp tác với Đại sứ quán Đức tại Hà Nội đã tổ chức cuộc thi ảnh, với mong muốn đưa vẻ đẹp của di sản văn hóa và sáng tạo văn hóa Việt Nam tới với cộng đồng', '2021-06-01 00:00:00', '2021-06-30 00:00:00', 'Cuộc thi mở rộng dành cho tất cả mọi người, chuyên nghiệp và nghiệp dư, không phân biệt tuổi tác, giới tính hay quốc tịch. Trong trường hợp người tham gia dự thi dưới 18 tuổi, cần có sự đồng ý của cha mẹ hoặc người giám hộ, bằng cách cung cấp những thông tin liên quan trong phần đăng ký dự thi.\r\nYêu cầu ảnh tham gia dự thi được chụp sau ngày 1/1/2019, có thể là ảnh màu hoặc đen trắng, được chụp bằng các thiết bị chuyên nghiệp, máy dân dụng, máy phim hoặc bằng điện thoại đã quét sang định dạng kỹ thuật số. Yêu cầu những bức ảnh dự thi chưa từng được gửi tham gia bất kỳ cuộc thi ảnh nào.\r\nẢnh tham gia dự thi cần đáp ứng những yêu cầu cụ thể sau:\r\nHình ảnh được tải lên với kích thước pixel gốc. Không thay đổi độ phân giải của ảnh gốc\r\nẢnh dự thi được lưu dưới định dạng JPG với chất lượng cao. Lưu ý rằng, chúng tôi sẽ tái sử dụng những hình ảnh thắng cuộc.\r\nTác giả tham gia dự thi cam kết sở hữu quyền hình ảnh dự thi.\r\nTrong trường hợp bức ảnh xuất hiện những hình ảnh của cá nhân khác (ví dụ: ảnh chân dung), tác giả cần đảm bảo có sự đồng ý của cá nhân đó trước khi gửi hình ảnh dự thi cho UNESCO.\r\nKhông chấp nhận ảnh được xử lý kỹ thuật làm thay đổi nội dung, cấu trúc bức ảnh và bản chất sự việc.\r\nCác nhóm đối tượng người khuyết tật và dân tộc thiểu số được khuyến khích tham gia cuộc thi này.', 2, 1, );
INSERT INTO `contest` (`id`, `title`, `content`, `start_date`, `end_date`, `rule`, `categoryid`, `adminid`, `thumbnail`) VALUES
(4, 'Cuộc thi ảnh Quốc tế Circle 2021', 'Cuộc thi ảnh quốc tế Circle 2021 được tổ chức bởi Photo Art Group Prilep North, Macedonia. Cuộc thi được sự bảo trợ của IAAP số 029/2021, PSA – National số 006/2021.', '2021-06-09 00:00:00', '2021-07-07 00:00:00', '- Cuộc thi dành cho tất cả các nhà nhiếp ảnh chuyên và không chuyên trên thế giới dự thi.\r\n- Các tác giả chưa đủ tuổi dự thi phải được sự đồng ý của cha mẹ hoặc người giám hộ.\r\n- Tác phẩm dự thi có thể bị từ chối khi không tuân thủ theo quy định của Ban Tổ chức.\r\n- Tác giả dự thi phải chịu trách nhiệm về bản quyền tác phẩm của mình. Ban Tổ chức được quyền dùng các tác phẩm dự thi ở độ phân giải thấp để tuyên truyền quảng bá cho cuộc thi.', 3, 1, );

